import React, { Component } from 'react'
import Contact from './Contact'
import Home from './Home'

export default class ConditionalRendering extends Component {
    constructor(props){
        super(props)
        this.state = {
            isLogIn :  true
        }
    }
  render() {
    return (
      <div>
         {isLogIn === true ? <Home/> : <Contact/>}
      </div>
    )
  }
}
